            WriteLiteral(@"
        <p>Кондитерская «Кафе Пушкинъ» открылась в 2006 году рядом с одноименным рестораном. Андрей Деллос, лично руководивший оформлением интерьера, превратил ее в московский символ утонченной и изысканной французской кондитерской. Роскошный барочный комод с антикварным китайским фарфором, мебель нежно молочных, жемчужно-серебристых и голубых тонов, позолота и хрусталь – все это создает великолепную обстановку французского дворца XVIII века. Персонал, одетый в духе того времени, окончательно дополняет атмосферу и переносит гостей из современной столицы в Париж, Венецию или Петербург времен королей и императоров.</p>
